import React from 'react';
import { useNavigate } from 'react-router-dom';

const Header = () => {
  const navigate = useNavigate();

  const handleNavigation = (path) => {
    navigate(path);
  };

  return (
    <header>
      <button onClick={() => handleNavigation('/about')}>About</button>
      {/* Other buttons/links */}
    </header>
  );
};

export default Header;
